A Polícia Militar do Paraná repudiou a divulgação de mensagens falsas nas redes sociais e em grupos de Whatsapp que relatam um suposto atentado que teria provocado a morte do comandante-geral da PMPR (Polícia Militar do Paraná), Coronel Hudson Leôncio Teixeira.... - Veja mais em https://noticias.uol.com.br/politica/ultimas-noticias/2022/11/26/pm-repudia-fake-news-sobre-suposta-morte-do-comandante-geral-no-parana.htm?cmpid=copiaecola
